import axios from 'axios';

const base_url = 'http://localhost:8888/voitures';

const findALL = () => {
    return axios.get(`${base_url}`);
};
const saveCar = (client) => {
    return axios.post(`${base_url}`, client);
}
const findById = (id) => {
    return axios.get(`${base_url}/${id}`);
}

const CarServices = {
    findALL,
    findById,
    saveCar
}

export default CarServices;
